    <div className='h-screen w-full bg-slate-50'>
      <div className="row">
            {<BreadCrumb />}
        {/* <div className='w-full px-8 sm:px-36 py-8 sm:py-36'> */}
              {<GameSelectionCard games={gameInfos} />}
        {/* </div> */}
      </div>
    </div>
  )
}

export default LandingPage
